(1, 'Chair', '2024-07-29 07:21:02', '2024-07-19 11:10:53', 'Black Chair', 'Kursi kantor MH 273\r\nPacking kardus dan BELUM DIRAKIT (kami tidak menerima jasa perakitan)\r\n\r\nsandaran tangan 1D (naik turun/adjustable)\r\nTinggi terendah 28cm\r\nTinggi tertinggi 35,5cm\r\nPenambahan tinggi adjustable 7.5cm\r\n\r\nSandaran reclining\r\n\r\nDukungan Tulang Belakang\r\nDirancang untuk duduk dilekukan bagian punggung bawah Anda untuk meningkatkan postur duduk\r\n\r\nHeadrest yang bisa disesuaikan\r\nUntuk mencegah kepala Anda dari hentakan dalam untuk tetap terjaga dengan tulang belakang anda\r\n\r\nBreathable Fabric\r\nDengan breathable fabric berkualitas baik yang berfungsi untuk mengalirkan udara agar tidak menyebabkan kelembaban\r\n\r\nBusa dengan kepadatan tinggi\r\nDengan busa kepadatan tinggi yang membuat Anda nyaman dan selalu bugar\r\n\r\nNylon Bintang 5\r\nDengan rangka kaki yang terbuat dari nilon ringan agar lebih mudah berger\r\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\r\nOriginal Frasser\r\nKursi Kantor Import / Office Chair / Kursi Jaring/LH 173/OC 268\r\nHitam sandaran Hitam\r\n\r\nKursi Jaring | Kursi Import | Office Chair | Kursi Kantor\r\n', '400', 0, 0, 82, 0, 'Deskripsi Produk:\r\n- Produk 100% asli import\r\n- Rangka kaki Besi\r\n- Hidrolik (bisa naik turun)\r\n- Ada roda\r\n\r\nPacking kardus dan BELUM DIRAKIT (kami tidak menerima jasa perakitan)\r\n\r\nHarga Grosir\r\nHitam/Abu/Stabilo/Orange/Biru Rp 290.000\r\nOC 268 Rp 365.00', 'NOTE :\r\n- TIDAK ADA REQUEST DIKIRIM RANDOM\r\n- UNTUK REQUEST WARNA DAN UKURAN HARAP DITULIS DI NOTE TRANSAKSI / PESAN PEMBELI\r\n- DI HARAPKAN MEMAKAI ASURANSI\r\n- KAMI TIDAK BERTANGGUNG JAWAB ATAS KERUSAKAN YANG DI TIMBULKAN OLEH KURIR PENGIRIMAN\r\n- TIDAK AD', '23', 0, 121, 122),
(2, 'Chair', '2024-07-29 07:20:54', '2024-07-22 09:19:55', 'Brown Chair', 'KURSI KANTOR RECLINING BISA SAMPAI 120 DERAJAT DAN DIKUNCI MENGUNAKAN MEKANIS DIBAWAH DUDUKAN AGAR SANDARAN TIDAK BALIK ARAH , NYAMAN DUDUK NONTON TV', '500', 0, 0, 83, 0, 'SPESIFIKASI :\r\n\r\n- TERDAPAT SANDARAN KAKI YG BISA DORONG MASUK KELUAR DAN SIMPAN DIBAWAH DUDUKAN\r\n- DIBAGIAN KEPALA BUSA TEBAL YG EMPUK\r\n- BAGIAN DIPUNGGUNG DAPAT BANTALAN\r\n- BESI KAKI BINTANG DICHROME\r\n- DUDUKAN BISA DIATUR NAIK TURUN PAKAI HIDROLIK\r\n- T', 'ONGKIR CARGO YG TERTERA SUDAH SESUAI , TIDAK ADA TAMBAHAN BIAYA KAK\r\n\r\n* untuk pengiriman wilayah JAKARTA waktu saat melakukan pembelian bisa memilih pengiriman pakai kurir GRAB .... langsung pilih yang kurir GRAB ... agar barang cepat dikirim sampai bi', '10', 0, 118, 120),
(3, 'Chair', '2024-07-29 09:13:07', '2024-07-22 09:20:32', 'Outdoor Chair', 'Keunggulan:\r\n\r\n1. Portabilitas: Salah Satu Kelebihan Terbesar Dari Kursi Lipat Outdoor Adalah Kemampuannya Untuk Dilipat Menjadi Ukuran Yang Lebih Kecil. Ini Memudahkan Anda Untuk Membawa Kursi Ke Berbagai Lokasi Dengan Mudah. Ketika Tidak Digunakan, Kursi Lipat Dapat Dengan Nyaman Disimpan Di Dalam Mobil, Ruang Penyimpanan, Atau Digantung Di Dinding.\r\n\r\n2. Kualitas Dan Ketahanan: Kursi Lipat Outdoor Terbuat Dari Bahan Baja Dan Aluminium Yang Ringan Tetapi Kuat.\r\n\r\n3. Desain Yang Ringkas: Kursi Lipat Outdoor Dirancang Dengan Desain Yang Ringkas Dan Elegan.\r\n\r\n4. Multifungsi: Kursi Lipat Outdoor Dapat Digunakan Dalam Berbagai Aktivitas Di Luar Ruangan. Cocok Untuk Digunakan Saat Berkemah, Piknik, Acara Olahraga, Konser, Pantai, Taman, Dan Banyak Lagi.\r\n\r\n5. Kemudahan Penggunaan: Kursi Lipat Outdoor Dirancang Untuk Kepraktisan Dan Anda Dapat Mengatur Tempat Duduk Yang Nyaman Dengan Cepat Dan Efisien Saat Diperlukan.\r\n', '200', 0, 0, 123, 0, 'Spesifikasi:\r\n\r\nVariasiÔºöKursi Moon\r\nBahanÔºöKain Oxford\r\nWarnaÔºöHitam„ÄÅHijau„ÄÅKhaki\r\nUkuran KursiÔºö64.5*44.5*44.5cm\r\nUkuran TasÔºö65*15*15cm\r\nBantalan BebanÔºö150kg', 'Dikirim dari Kab. Tangerang\r\nOngkir Reguler 8 rb - 10 rb\r\nEstimasi tiba besok - 3 Agu\r\nKurir lainnya:\r\nInstan', '20', 0, 124, 125),
(4, 'Chair', '2024-07-29 09:13:29', '2024-07-22 09:21:18', 'Double Chair', 'STARLEAD menjamin bahwa semua produk yang di jual adalah 100% original. Pesanan akan di kirim dalam waktu 3x24 jam setelah checkout. Kami berkomitmen untuk menjadikan kepuasan pelanggan sebagai nomor satu dan menjamin pelayanan yang sangat bermutu, termasuk layanan pasca penjualan.', '550', 0, 0, 126, 0, '-Untuk pengiriman di luar jabodetabek mohon hubungi customer service kami untuk info selanjutnya mengenai metode pengiriman & biaya pengiriman\r\n-Pengiriman H+3 setelah pembayaran\r\n\r\nKode : YZ17001 | YZ17002 | YZ17003\r\nUkuran : 40cm x 42cm x 88 cm\r\nBahan /', 'Keunggulan Produk :\r\nüëâ Material Berkualitas\r\nüëâ Daun Kursi & Sandaran Kursi Yang Empuk\r\nüëâ Frame Kursi Yang Kuat & Tahan Karat\r\nüëâ Tampilan dan Desain yang Menarik\r\n\r\n\r\nJika paket pengirimannya terjadi kendala ataupun tingkat kepuasan anda merasa kurang, sil', '232', 0, 127, 128),
(5, 'Chair', '2024-07-29 09:15:57', '2024-07-22 09:21:49', 'Indoor Chair', 'Hloo Boskuu Tokopedia LoverZz\r\n\r\nEDisi PROMOOOOO !!!\r\nWajib dibaca ! Saran pemilihan kurir.\r\n\r\nGojek online : \r\nuntuk wilayah JADETABEK bisa memilih Gosend Instant Courier atau grabb instan \r\nsatu kursi per satu x transaksi/order/Driver\r\n\r\nLuar DKI Jakarta atau yg tdk terjangkau oleh Gojek online dapat memakai Kurir JNT dan SICEPAT untuk satu x transaksi order\r\n\r\nUntuk pembelian banyak atau tidak terjangkau gojek, bisa memilih pakai kurir toko atau Ekspedisi Cargo. Berat di thread ini disesuaikan hanya untuk gojek online saja\r\n\r\nYg terbaik dari kami kursi kantor staff dengan kondisi Refurbished yg dijamin 90%Menyerupai barang Baru lagiii\r\n\r\nSemua komponen berpungsi baik dan normal \r\nTerdapat hydrolik utk mengatur Tinggi rendah duduk anda \r\nSehingga nyaman dan elegan\r\nWA admin 0821 2583 8530\r\n\r\nYUUK silahkan di serbuuu\r\n', '300', 0, 0, 129, 0, 'Hloo Boskuu Tokopedia LoverZz\r\n\r\nEDisi PROMOOOOO !!!\r\nWajib dibaca ! Saran pemilihan kurir.\r\n\r\nGojek online : \r\nuntuk wilayah JADETABEK bisa memilih Gosend Instant Courier atau grabb instan \r\nsatu kursi per satu x transaksi/order/Driver\r\n\r\nLuar DKI Jakart', 'Hloo Boskuu Tokopedia LoverZz\r\n\r\nEDisi PROMOOOOO !!!\r\nWajib dibaca ! Saran pemilihan kurir.\r\n\r\nGojek online : \r\nuntuk wilayah JADETABEK bisa memilih Gosend Instant Courier atau grabb instan \r\nsatu kursi per satu x transaksi/order/Driver\r\n\r\nLuar DKI Jakart', '20', 0, 130, 131),
(6, 'Chair', '2024-07-29 09:16:17', '2024-07-22 09:22:21', 'SPA Chair', 'Sofa untuk pusat donor darah atau cuci darah. Operasi elektrik dapat memberikan pasien 5 pilihan posisi selama proses perawatan. Desain ergonomis memberi pasien pengalaman yang lebih nyaman. Ideal untuk pusat dialisis, pusat donor darah dan panti jompo.', '500', 0, 0, 132, 0, 'Fitur\r\n\r\n- Pegangan dorong empuk untuk kemudahan manuver.\r\n\r\n- Sandaran lengan empuk ekstra lebar memaksimalkan kenyamanan\r\n\r\n- Rangka Terbuat dari stainless steel yang tahan lama mudah dibersihkan dan dirawat \r\n\r\n- Dilengkapi dengan 3 motor untuk penye', 'INFO PENGIRIMAN :\r\n\r\nSilahkan kordinasikan lokasi pengiriman anda kepada kami melalui chat.\r\nInfo Lebih Lanjut Telepon,WA,SMS #0812 1137 0412\r\n\r\nUNTUK LUAR WILAYAH JABODETABEK\r\n\r\nPengiriman Melalui Cargo / Ekspedisi Diluar Online Shop . Sesuai Kesepakatan', '213', 0, 133, 134),
(7, 'Chair', '2024-07-29 09:16:40', '2024-07-22 09:22:52', 'SPA Chair', 'Info Kursi Pijat lengkap bisa menghubungi kami via whatsapp 0813 8078 3912. Kunjungi Lokasi kami di Mall ptc pulogadung Jakarta timur lantai dasar kios blok A70 \r\ndan\r\nKoja trade mall lantai GF Ca01 Pintu Barat jakarta utara \r\n\r\nTarif penggunaan di tempat kami untuk di lokasi kami adalah sebagai berikut\r\nTipe sedang Rp 10.000 untuk 1 kali pakai durasi \r\n\r\nSegera kunjungi lokasi kami dan coba beberapa unit lainnya apa bila ingin membelinya untuk di rumah.\r\n\r\nTransaksi ini hanya mengirimkan Brosur undangan dan voucher saja. Hubungi 0813 8078 3912 untuk info lebih jelasnya', '1200', 0, 0, 135, 0, 'Info Kursi Pijat lengkap bisa menghubungi kami via whatsapp 0813 8078 3912. Kunjungi Lokasi kami di Mall ptc pulogadung Jakarta timur lantai dasar kios blok A70 \r\ndan\r\nKoja trade mall lantai GF Ca01 Pintu Barat jakarta utara \r\n\r\nTarif penggunaan di tempat', 'Info Kursi Pijat lengkap bisa menghubungi kami via whatsapp 0813 8078 3912. Kunjungi Lokasi kami di Mall ptc pulogadung Jakarta timur lantai dasar kios blok A70 \r\ndan\r\nKoja trade mall lantai GF Ca01 Pintu Barat jakarta utara \r\n\r\nTarif penggunaan di tempat', '32', 0, 136, 137),
