(5, 'ShopObject', '2024-09-02 03:45:28', '2024-07-22 10:48:42', 'Long Sofa Green', 'engkapi ruang tamu atau ruang keluarga Anda dengan sofa yang nyaman saat digunakan dan dengan tampilan elegan.\r\n\r\nLULABY RECLINER SOFA\r\n\r\nDengan busa yang tebal akan membuat nyaman saat diduduki dan dengan material artificial leather maka feel dan kulit Anda akan cukup merasakan kelembutan saat bersentuhan dengan sofa.\r\n\r\nSofa dari LULABY adalah model recliner yang membuat saat Anda bersantai menjadi lebih maksimal, karena Anda bisa mendapatkan posisi tidur saat digunakan. Dengan mekanisme tuas yang berada di samping sofa membuatnya mudah untuk diraih dan diaplikasikan.\r\n\r\nDimensi produk: 95 x 94 x 97 cm\r\nBahan: Artificial Leather\r\nWarna : Brown', 0, 0, 0, 0, 94, 0, 0, '10000', 'KETENTUAN ORDER\r\n1. Free Ongkir hanya untuk WILAYAH JABODETABEK KOTA dengan minimum order 1 Jt pengiriman menggunakan kurir Atria Furniture ( Customer Logistic ) dan Free Installasi langsung dengan Chat terlebih dahulu ke Admin.\r\n2. Orderan kurang dari 1J', 'Ukuran berat produk\r\nUkuran berat produk pada informasi produk yang kami jual sudah termasuk ukuran berat kemasan (bungkus/box) pengiriman.\r\n\r\nPerhitungan Ongkos Kirim dengan pihak ke 3 seperti JNE, TIki dan Sicepat tidak hanya memperhitungan berat real p', '20', 0, 94, 94, 0, '11000 ', '12000 ', '90', '32', 92, 'Long Sofa Green LL', 'Long Sofa Green LL', 'Long Sofa Green'),
